import axios from 'axios';

export default repass = async (username, password, email) => {
  try {
    const newUser = {
      user: username,
      pass: password,
      email: email
    };

    const response = await axios.post("/users/repass", newUser);
    return response; 

  } catch (error) {
    console.error('Error resetting password:', error);
    throw error; // Ném lỗi để bên gọi xử lý
  }
};
